We have a strange problem with the grid layout:

We are displaying a label inside the grid layout.
The text of the label is localized.
The german text is displayd correctly, but the english text (which is a bit shorter) is not displayd correctly.

This problem can be reproduces by copying the following code into the qooxdoo playground.

      var container = new qx.ui.container.Composite();
      var containerLayout = new qx.ui.layout.Grid(20, 20).setColumnFlex(1, 1);
      container._setLayout(containerLayout);
      container.setWidth(300);
      container.setMaxWidth(300);

      var subContainer = new qx.ui.container.Composite();
      var subContainerLayout = new qx.ui.layout.Grid(11, 11);
      subContainerLayout.setColumnFlex(1, 1);
      subContainer._setLayout(subContainerLayout);
      container.add(subContainer, {row: 1, column: 0});
      subContainer.setBackgroundColor("#FF0000");

      var icon = new qx.ui.basic.Image();
      icon.set({width: 30, height: 30});
      subContainer._add(icon, { row : 0, column : 0, rowSpan : 2 });

      var label = new qx.ui.basic.Label();
      label.setMaxWidth(250);
      label.setRich(true);
      label.setValue("a shorter text a shorter text a shorter text short");
      // label.setValue("a very long text a very long text a very long text a very long text");
      subContainer._add(label, { row : 1, column : 1});

      var doc = this.getRoot();
      doc.add(container, {left: 100, top: 50});

Managed to reduce the example:

var subContainer = new qx.ui.container.Composite();
subContainer.setLayout(new qx.ui.layout.Grid(0, 14));
subContainer.setBackgroundColor("#FF0000");

var icon = new qx.ui.basic.Image();
icon.setBackgroundColor("blue");
icon.set({width: 30, height: 30});
subContainer.add(icon, { row : 0, column : 0, rowSpan : 2 });

var label = new qx.ui.basic.Label("a shorter text a shorter text a shorter text short");
subContainer.add(label, { row : 1, column : 1});

this.getRoot().add(subContainer, {left: 100, top: 50});

This seems to fail cross OS / browser. Seems like it worked on the mac due to some other font types used...

Here is the final code to test including a slider to change the spacing.


subContainer = new qx.ui.container.Composite();
subContainer.setLayout(new qx.ui.layout.Grid(0, 14));
subContainer.setBackgroundColor("red");

icon = new qx.ui.basic.Image();
icon.setBackgroundColor("blue");
icon.set({width: 30, height: 30});
subContainer.add(icon, { row : 0, column : 0, rowSpan : 2 });

label = new qx.ui.basic.Label("a shorter text a shorter text a shorter text short");
subContainer.add(label, { row : 1, column : 1});

this.getRoot().add(subContainer, {left: 100, top: 50});

var s = new qx.ui.form.Slider();
this.getRoot().add(s);
s.setWidth(100);
s.setMaximum(30);
s.setValue(14);
s.addListener("changeValue", function(e) {
  subContainer.getLayout().setSpacingY(e.getData());
}, this);

var l = new qx.ui.basic.Label();
this.getRoot().add(l, {left: 110});
s.bind("value", l, "value");


The bug way located in the grid layouts calculation if the cell having a colspan is higher than the cells its spanning. In the use case showed in the example, thats the case because the icon has a height of 30, the label a height of 15 and the spacing is 14 which means, the right two rows are, with no widget at the top right position, in total with spacing 29px heigh which is on pixel short. The old algorithm just ignored everything and shared the size between the two columns --> It should be 30 - 14 spacing comes to 16 which means 8 for each --> the top cell had  a height of 8 + 14 spacing puts the label at the lower edge of the container. 

The solution is to not change the cells height to a lower number they already have.

